import styled from "styled-components";
import Title from "../../ui/title/title";

export const HeroTitle = styled(Title)`
  margin-bottom: 40px;
  margin-left: 70px;
  font-style: italic;
  font-weight: 400;
  text-transform: uppercase;
`;

export const HeroSection = styled.section`
  margin-bottom: 120px;
  min-height: 500px;
`;
